import React from 'react';
import { Form, Button, Col, Row, Container, Stack, Tooltip, OverlayTrigger } from "react-bootstrap";

function Home() {
    const tooltip1 = () => (
        <Tooltip id="button-tooltip">
            Try randomly generated problems using the sin, cos, or tan formulas!
        </Tooltip>
    )

    return (
        <Container fluid>
            <h1>Triangle Problems Practice Tool</h1>
            <Stack gap={5} className="col-md-6 mx-auto">
                <OverlayTrigger
                    placement="bottom"
                    overlay={tooltip1}
                >
                    
                </OverlayTrigger>
                <Button variant="outline-primary">Practice sin/cos/tan Problems</Button>
                <Button variant="outline-primary">Draw Triangles</Button>
                <Button variant="outline-primary">Practice Law of Sines/Cosines Problems</Button>
            </Stack>
            
        </Container>
    );
};

export default Home;
